  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
vec4 CCFragOutput (vec4 color) {
  #if OUTPUT_TO_GAMMA
    color.rgb = sqrt(color.rgb);
  #endif
	return color;
}
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif
#if USE_ALPHA_CUTOFF
uniform sampler2D alphaTexture;
uniform alpha_cutoff {
  vec2 alphaMove;
  float alphaUVSizeX;
  float alphaUVSizeY;
  float alphaSpeed;
  float alphaStrength;
  float cutOffStrenght;
};
#endif
#if USE_LINEAR_GRADIENT
uniform linear {
  vec4 alphaLinear;
};
#endif
#if USE_CIRCULAR_GRADIENT
uniform circular {
  float alphaCircular;
};
#endif
#if USE_BLINK
  uniform blink {
    float blinkSpeed;
    float blinkStrength;
    float blinkAmp;
  };
#endif
uniform shaderParams {
  vec4 mainColor;
  vec2 uvOffset;
  float multiplyFactor;
  float darkValues;
  float lightValues;
  float peakDelay;
  float deltaTime;
  float impulseSpeed;
};
float overlay (float _dst, float _src) {
  return clamp(mix( (darkValues*_dst*_src), (1.0-(1.0-lightValues*(_dst-0.5))*(1.0-_src)), step(0.5, _src) ), 0.0 ,1.0);
}
float linearPulse( float c, float w, float x, float pos1, float pos2 ){
  x = abs(x - c);
  if( x>w ) return 0.0;
  x /= w;
  return 1.0 - x*x*(pos1-pos2*x);
}
float circle(in vec2 _st, in float _radius)
{
  vec2 dist = _st-vec2(0.5,0.5);
  return 1.-smoothstep(_radius-(_radius*0.5),_radius+(_radius*0.5),dot(dist,dist)*7.0);
}
 float impulse( float k, float x )
 {
  float h = k*x;
  return h*exp(1.0-h);
}
 float Remap_float(float In, vec2 InMinMax, vec2 OutMinMax)
{
  float Out = OutMinMax.x + (In - InMinMax.x) * (OutMinMax.y - OutMinMax.x) / (InMinMax.y - InMinMax.x);
  return Out;
}
vec4 overlay() {
  vec4 color = vec4(1, 1, 1, 1);
  float deltaTime = impulse(impulseSpeed,deltaTime - peakDelay);
  #if USE_TEXTURE
    color = texture(texture, v_uv0 + uvOffset);
    color.r = overlay(color.r ,v_color.r);
    color.g = overlay(color.g ,v_color.g);
    color.b = overlay(color.b ,v_color.b);
  #endif
  #if USE_ALPHA_CUTOFF
    vec2 uv = v_uv0;
    uv.x *= alphaUVSizeX;
    uv.y *= alphaUVSizeY;
    float time = alphaSpeed * cc_time.x;
    #if USE_LINEAR_GRADIENT
      float linear  = linearPulse(alphaLinear.w,alphaLinear.x,v_uv0.y,alphaLinear.y, alphaLinear.z);
    #endif
    #if USE_CIRCULAR_GRADIENT
      float circular  = circle(v_uv0,alphaCircular);
    #endif
    vec4 alphaCutoff = texture(alphaTexture,uv + (alphaMove * time));
    alphaCutoff.r *= Remap_float(deltaTime,vec2(0.0,1.0),vec2(-0.5,0.1)) * cutOffStrenght;
    color.a *= alphaStrength;
    #if USE_LINEAR_GRADIENT
      color.a *= mix(color.a, alphaCutoff.r , linear);
    #endif
    #if USE_CIRCULAR_GRADIENT
      color.a *= circular;
    #endif
  #endif
  #if USE_BLINK
    float blinkTime = blinkSpeed * cc_time.x;
    color.a *= sin(blinkTime * blinkAmp) * blinkStrength + 1.0;
  #endif
  return CCFragOutput(color);
}
