    vec4 alphaCutoff = texture(alphaTexture,uv + (alphaMove * time));
    alphaCutoff.r *= cutOffStrenght;
    color.a *= alphaStrength;
    #if USE_LINEAR_GRADIENT
      color.a *= mix(color.a, alphaCutoff.r , linear);
    #endif
    #if USE_CIRCULAR_GRADIENT
      color.a *= circular;
    #endif
  #endif
  #if USE_BLINK
    float blinkTime = blinkSpeed * cc_time.x;
    color.a *= sin(blinkTime * blinkAmp) * blinkStrength + 1.0;
  #endif
  color *= v_color;
  return CCFragOutput(color);
}
out vec4 cc_FragColor;
void main() { cc_FragColor = overlay(); }

glsl1.vert:
precision highp float;
uniform mat4 cc_matViewProj;
uniform mat4 cc_matWorld;
attribute vec3 a_position;
attribute vec4 a_color;
varying vec4 v_color;
#if USE_TEXTURE
attribute vec2 a_uv0;
varying vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl1.frag:
precision highp float;
vec4 CCFragOutput (vec4 color) {
  #if OUTPUT_TO_GAMMA
    color.rgb = sqrt(color.rgb);
  #endif
	return color;
}
uniform vec4 cc_time;
varying vec4 v_color;
#if USE_TEXTURE
varying vec2 v_uv0;
uniform sampler2D texture;
#endif
#if USE_ALPHA_CUTOFF
uniform sampler2D alphaTexture;
uniform vec2 alphaMove;
uniform float alphaUVSizeX;
uniform float alphaUVSizeY;
uniform float alphaSpeed;
uniform float alphaStrength;
uniform float cutOffStrenght;
#endif
#if USE_LINEAR_GRADIENT
uniform vec4 alphaLinear;
#endif
#if USE_CIRCULAR_GRADIENT
uniform float alphaCircular;
#endif
#if USE_BLINK
  uniform float blinkSpeed;
uniform float blinkStrength;
uniform float blinkAmp;
#endif
uniform vec4 mainColor;
uniform vec2 uvOffset;
uniform float darkValues;
uniform float lightValues;
float overlay (float _dst, float _src) {
  return clamp(mix( (darkValues*_dst*_src), (1.0-(1.0-lightValues*(_dst-0.5))*(1.0-_src)), step(0.5, _src) ), 0.0 ,1.0);
}
float linearPulse( float c, float w, float x, float pos1, float pos2 ){
  x = abs(x - c);
  if( x>w ) return 0.0;
  x /= w;
  return 1.0 - x*x*(pos1-pos2*x);
}
float circle(in vec2 _st, in float _radius)
{
  vec2 dist = _st-vec2(0.5,0.5);
  return 1.-smoothstep(_radius-(_radius*0.5),_radius+(_radius*0.5),dot(dist,dist)*7.0);
}
vec4 overlay() {
  vec4 color = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
    color = texture2D(texture, v_uv0 + uvOffset);
    color.r = overlay(color.r ,mainColor.r);
    color.g = overlay(color.g ,mainColor.g);
    color.b = overlay(color.b ,mainColor.b);
  #endif
  #if USE_ALPHA_CUTOFF
    vec2 uv = v_uv0;
    uv.x *= alphaUVSizeX;
    uv.y *= alphaUVSizeY;
    float time = alphaSpeed * cc_time.x;
    #if USE_LINEAR_GRADIENT
      float linear  = linearPulse(alphaLinear.w,alphaLinear.x,v_uv0.y,alphaLinear.y, alphaLinear.z);
    #endif
    #if USE_CIRCULAR_GRADIENT
      float circular  = circle(v_uv0,alphaCircular);
    #endif
    vec4 alphaCutoff = texture2D(alphaTexture,uv + (alphaMove * time));
    alphaCutoff.r *= cutOffStrenght;
    color.a *= alphaStrength;
    #if USE_LINEAR_GRADIENT
      color.a *= mix(color.a, alphaCutoff.r , linear);
    #endif
    #if USE_CIRCULAR_GRADIENT
      color.a *= circular;
    #endif
  #endif
  #if USE_BLINK
    float blinkTime = blinkSpeed * cc_time.x;
    color.a *= sin(blinkTime * blinkAmp) * blinkStrength + 1.0;
  #endif
  color *= v_color;
  return CCFragOutput(color);
}
void main() { gl_FragColor = overlay(); }
